(1, 1, 1, 'Honda ADV 150 គឺជាម៉ូតូ​អូតូ​បែប​ ​On', 'Lorem Ipsum is simply dummy text', 'Lorem Ipsum គឺវាជាការពិតដែលបានបង្កើតឡើងយូរមកហើយដែលអ្នកអាននឹងត្រូវបានរំខានដោយមាតិកាដែលអាចអានបាននៃទំព័រនៅពេលដែលក្រឡេកមើលប្លង់របស់វា។ ចំនុចនៃការប្', 'It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using', 'uploads/1/2020-01/5e0d5661906ba_1577932380_small.jpg', '<p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 9pt; font-family: &quot;Khmer OS&quot;;\">Lorem Ipsum <span lang=\"KHM\">គឺវាជាការពិតដែលបានបង្កើតឡើងយូរមកហើយដែលអ្នកអាននឹងត្រូវបានរំខានដោយមាតិកាដែលអាចអានបាននៃទំព័រនៅពេលដែលក្រឡេកមើលប្លង់របស់វា។\r\nចំនុចនៃការប្រើ </span>Lorem Ipsum <span lang=\"KHM\">គឺថាវាមានការចែកចាយអក្សរធម្មតាឬមិនធម្មតាជាងផ្ទុយពីការប្រើប្រាស់មាតិកានៅទីនេះមាតិកានៅទីនេះធ្វើឱ្យវាមើលទៅដូចជាភាសាអង់គ្លេសដែលអាចអានបាន។\r\nកញ្ចប់បោះពុម្ភផ្សាយផ្ទៃតុជាច្រើននិងកម្មវិធីនិពន្ធទំព័របណ្តាញឥឡូវនេះប្រើ </span>Lorem\r\nIpsum <span lang=\"KHM\">ជាអត្ថបទគំរូលំនាំដើមរបស់ពួកគេហើយការស្វែងរក </span>\'lorem\r\nipsum\' <span lang=\"KHM\">នឹងបង្ហាញគេហទំព័រជាច្រើននៅមិនទាន់មាននៅឡើយទេ។\r\nកំណែជាច្រើនបានវិវឌ្ឍជាច្រើនឆ្នាំមកហើយជួនកាលដោយគ្រោះថ្នាក់ចរាចរណ៍ពេលខ្លះមានគោលបំណង\r\n(កំប្លុកកំប្លែងនិងការស្រដៀងគ្នា) ។</span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><img src=\"http://localhost:8000/uploads/1/2020-01/5dfc71f6fc84a627169a8d69f44b150a.jpg\" style=\"width: 740.5px; height: 416.713px;\"><span style=\"font-size: 9pt; font-family: &quot;Khmer OS&quot;;\"><span lang=\"KHM\"><br></span><o:p></o:p></span></p>', '<p><span style=\"font-size: 10.5pt; line-height: 107%; font-family: &quot;Open Sans&quot;, sans-serif;\">It is a long established fact\r\nthat a reader will be distracted by the readable content of a page when looking\r\nat its layout. The point of using Lorem Ipsum is that it has a more-or-less\r\nnormal distribution of letters, as opposed to using \'Content here, content\r\nhere\', making it look like readable English. Many desktop publishing packages\r\nand web page editors&nbsp;</span><img src=\"http://localhost:8000/uploads/1/2020-01/1ed16dbf438e920e98b066e8776fc76c.jpg\"><br></p>', 0, '2019-12-29 20:42:07', '2020-01-04 20:58:36'),
