(12, 0, 1, 'បើក​ឡើង​ចំណោត​បើក​ឡើង​ចំណោត​សាក​មើល​រួច​អត់ (មាន​វីដេអូ)', 'normally dummy text of the printing and typesetting industry.', 'រដេញថ្លៃចុងក្រោយបំផុត។ វាត្រូវបានបង្កើតឡើងដោយប្រើឧបករណ៍អេឡិចត្រូនិច។ សក្ដានុពលលឿន។', 'ly dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard', 'uploads/1/2020-01/a.jpg', '<p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 9pt; font-family: &quot;Khmer OS&quot;;\">Lorem Ipsum <span lang=\"KHM\">គឺ</span>Quisque <span lang=\"KHM\">និង </span>lectus\r\nac <span lang=\"KHM\">គឺជាលទ្ធផលនៃការនិងមិនមែន។ វាត្រូវបានគេប្រើដើម្បីកំណត់អត្តសញ្ញាណប្រភេទនេះ</span>,\r\n<span lang=\"KHM\">ប៉ុន្តែវាត្រូវបានបង្កើតឡើងដោយ </span>Malesuada <span lang=\"KHM\">ឬ។\r\nអ្នកគួរតែប្រើវិធីសាស្រ្តដើម្បីឱ្យវាមានលក្ខណៈធម្មតា។ អ្នកអាចរកទិញឬក៏អ្នកដាក់លក់ឬទិញផលិតផលដែលអ្នកទទួលបាន។\r\nមានពាសពេញខ្មោចដែលមិនមានត្រចៀកកាំ។ មុខឺម៉ិចត្រូវបានគេស្គាល់ថាជាពហុគុណ។ លោក </span>Nam\r\n<span lang=\"KHM\">នៅលើសំណុំបែបបទ។ បញ្ចប់ការដេញថ្លៃចុងក្រោយបំផុត។ វាត្រូវបានបង្កើតឡើងដោយប្រើឧបករណ៍អេឡិចត្រូនិច។\r\nសក្ដានុពលលឿន។ សាប៊ូលាបសន្លាក់។ វាត្រូវបានបង្កើតឡើងដោយមិនត្រូវបានបង្កើតឡើងដើម្បីឱ្យមានលទ្ធផលល្អ។\r\nវាត្រូវបានបង្កើតឡើងដើម្បីឱ្យមានការបើកចំហរនិងការធ្វើឱ្យប្រសើរឡើង។ អ្នកអាចរកមើលឃើញនូវអ្វីដែលអ្នកចង់បាន។\r\nប្រសិនបើអ្នកទទួលបានលទ្ធផល</span>, <span lang=\"KHM\">អ្នកគួរតែទទួលបានអាហារពេលព្រឹក។\r\nអ្នកមិនគួរអានឬអានសៀវភៅនេះទេ។ សូមអរគុណ។ នៅក្នុង </span>orci <span lang=\"KHM\">នៅកន្លែងកើតហេតុ\r\n</span>sodales <span lang=\"KHM\">ស្ងួត។ ក្រមួននិងឈើឆ្កាង។ អ្នកត្រូវធ្វើអត្តសញ្ញាណប័ណ្ណនិមួយៗ។</span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><img src=\"http://localhost:8000/uploads/1/2020-01/dc10b4e01065120436983af1df38074a.jpg\" style=\"width: 100%;\"><span style=\"font-size: 9pt; font-family: &quot;Khmer OS&quot;;\"><span lang=\"KHM\"><br></span></span><span style=\"font-size: 10.5pt; font-family: &quot;Open Sans&quot;, sans-serif;\"><o:p></o:p></span></p>', '<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><strong><span style=\"font-size: 10.5pt; font-family: &quot;Open Sans&quot;, sans-serif;\">Lorem Ipsum</span></strong><span style=\"font-size: 10.5pt; font-family: &quot;Open Sans&quot;, sans-serif;\">&nbsp;is\r\nsimply dummy text of the printing and typesetting industry. Lorem Ipsum has\r\nbeen the industry\'s standard dummy text ever since the 1500s, when an unknown\r\nprinter took a galley of type and scrambled it to make a type specimen book. It\r\nhas survived not only five centuries, but also the leap into electronic\r\ntypesetting, remaining essentially unchanged. It was popularised in the 1960s\r\nwith the release of Letraset sheets containing Lorem Ipsum passages, and more\r\nrecently with desktop publishing software like Aldus PageMaker including\r\nversions of Lorem Ipsum.<o:p></o:p></span></p><h2 style=\"margin: 0cm 0cm 7.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: DauphinPlain, serif;\">Why do we use\r\nit?<o:p></o:p></span></h2><p>\r\n\r\n\r\n\r\n</p><p style=\"margin: 0cm 0cm 11.25pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 10.5pt; font-family: &quot;Open Sans&quot;, sans-serif;\">It is a\r\nlong established fact that a reader will be distracted by the readable content\r\nof a page when looking at its layout. The point of using Lorem Ipsum is that it\r\nhas a more-or-less normal distribution of letters, as opposed to using \'Content\r\nhere, content here\', making it look like readable English. Many desktop\r\npublishing packages and web page editors now use Lorem Ipsum as their default\r\nmodel text, and a search for \'lorem ipsum\' will uncover many web sites still in\r\ntheir infancy. Various versions have evolved over the years, sometimes by\r\naccident, sometimes on purpose (injected humour and the like).<o:p></o:p></span></p>', 2, '2020-01-04 21:13:46', NULL),
(13, 0, 1, 'បើក​ឡើង​ចំណោត​សាក​មើល​រួច​អត់ បើក​ឡើង​ចំណោត​សាក​មើល​រួច​អត់', 'Lorem Ipsum iLorem Ipsum is simply dummy text of the printing', 'Lorem Ipsum គឺQuisque និង lectus ac គឺជាលទ្ធផលនៃការនិងមិនមែន។ វាត្រូវបានគេប្រើដើម្បីកំណត់អត្តសញ្ញាណប្រភេទនេះ', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry.', 'uploads/1/2020-01/b.jpg', '<p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"KHM\" style=\"font-size: 22pt; font-family: DaunPenh;\">អ្នកគួរតែទទួលបានលទ្ធផលល្អ</span></b><b><span style=\"font-size: 22pt; font-family: &quot;Open Sans&quot;, sans-serif;\"><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 9pt; font-family: &quot;Khmer OS&quot;;\">Lorem Ipsum <span lang=\"KHM\">គឺ</span>Quisque <span lang=\"KHM\">និង </span>lectus\r\nac <span lang=\"KHM\">គឺជាលទ្ធផលនៃការនិងមិនមែន។ វាត្រូវបានគេប្រើដើម្បីកំណត់អត្តសញ្ញាណប្រភេទនេះ</span>,\r\n<span lang=\"KHM\">ប៉ុន្តែវាត្រូវបានបង្កើតឡើងដោយ </span>Malesuada <span lang=\"KHM\">ឬ។\r\nអ្នកគួរតែប្រើវិធីសាស្រ្តដើម្បីឱ្យវាមានលក្ខណៈធម្មតា។ អ្នកអាចរកទិញឬក៏អ្នកដាក់លក់ឬទិញផលិតផលដែលអ្នកទទួលបាន។\r\nមានពាសពេញខ្មោចដែលមិនមានត្រចៀកកាំ។ មុខឺម៉ិចត្រូវបានគេស្គាល់ថាជាពហុគុណ។ លោក </span>Nam\r\n<span lang=\"KHM\">នៅលើសំណុំបែបបទ។ បញ្ចប់ការដេញថ្លៃចុងក្រោយបំផុត។ វាត្រូវបានបង្កើតឡើងដោយប្រើឧបករណ៍អេឡិចត្រូនិច។\r\nសក្ដានុពលលឿន។ សាប៊ូលាបសន្លាក់។ វាត្រូវបានបង្កើតឡើងដោយមិនត្រូវបានបង្កើតឡើងដើម្បីឱ្យមានលទ្ធផលល្អ។\r\nវាត្រូវបានបង្កើតឡើងដើម្បីឱ្យមានការបើកចំហរនិងការធ្វើឱ្យប្រសើរឡើង។ អ្នកអាចរកមើលឃើញនូវអ្វីដែលអ្នកចង់បាន។\r\nប្រសិនបើអ្នកទទួលបានលទ្ធផល</span>, <span lang=\"KHM\">អ្នកគួរតែទទួលបានអាហារពេលព្រឹក។\r\nអ្នកមិនគួរអានឬអានសៀវភៅនេះទេ។ សូមអរគុណ។ នៅក្នុង </span>orci <span lang=\"KHM\">នៅកន្លែងកើតហេតុ\r\n</span>sodales <span lang=\"KHM\">ស្ងួត។ ក្រមួននិងឈើឆ្កាង។ អ្នកត្រូវធ្វើអត្តសញ្ញាណប័ណ្ណនិមួយៗ។</span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 10.5pt; font-family: &quot;Open Sans&quot;, sans-serif;\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"KHM\" style=\"font-size: 22pt; font-family: DaunPenh;\">គឺជាអ្វីដែលខ្ញុំមាន</span></b><b><span style=\"font-size: 22pt; font-family: &quot;Open Sans&quot;, sans-serif;\">?<o:p></o:p></span></b></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 9pt; font-family: &quot;Khmer OS&quot;;\">Lorem Ipsum <span lang=\"KHM\">គឺគ្រាន់តែជាអត្ថបទអត់ចេះសោះនៃឧស្សាហកម្មបោះពុម្ពនិងកំណត់។\r\n</span>Lorem Ipsum <span lang=\"KHM\">គឺជាអត្ថបទក្លែងក្លាយរបស់ឧស្សាហកម្មដែលមិនធ្លាប់មានតាំងពីទសវត្សរ៍ឆ្នាំ\r\n</span>1500<span lang=\"KHM\">\r\nនៅពេលដែលម៉ាស៊ីនបោះពុម្ពមិនស្គាល់មួយបានថតរូបប្រភេទមួយហើយបានដាក់វាដើម្បីបង្កើតសៀវភៅគំរូ។\r\nវាបានរស់រានមានជីវិតមិនត្រឹមតែប្រាំសតវត្សប៉ុណ្ណោះទេប៉ុន្តែវាក៏ជាជំហានទៅជាការសរសេរជាអេឡិចត្រូនិចដែលនៅតែមិនផ្លាស់ប្តូរ។\r\nវាត្រូវបានប្រជាប្រិយភាពនៅទសវត្សឆ្នាំ </span>1960<span lang=\"KHM\">\r\nជាមួយនឹងការចេញផ្សាយសន្លឹក </span>Letraset <span lang=\"KHM\">ដែលមានអត្ថបទ </span>Lorem\r\nIpsum <span lang=\"KHM\">និងថ្មីៗនេះជាមួយនឹងកម្មវិធីបោះពុម្ភលើផ្ទៃតុដូចជា </span>Aldus\r\nPageMaker <span lang=\"KHM\">រួមទាំងកំណែរបស់ </span>Lorem Ipsum <span lang=\"KHM\">ផងដែរ។</span><o:p></o:p></span></p>', '<p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><strong><span style=\"font-size: 10.5pt; font-family: &quot;Open Sans&quot;, sans-serif;\">Lorem Ipsum</span></strong><span style=\"font-size: 10.5pt; font-family: &quot;Open Sans&quot;, sans-serif;\">&nbsp;is\r\nsimply dummy text of the printing and typesetting industry. Lorem Ipsum has\r\nbeen the industry\'s standard dummy text ever since the 1500s, when an unknown\r\nprinter took a galley of type and scrambled it to make a type specimen book. It\r\nhas survived not only five centuries, but also the leap into electronic\r\ntypesetting, remaining essentially unchanged. It was popularised in the 1960s\r\nwith the release of Letraset sheets containing Lorem Ipsum passages, and more\r\nrecently with desktop publishing software like Aldus PageMaker including\r\nversions of Lorem Ipsum.<o:p></o:p></span></p><h2 style=\"margin: 0cm 0cm 7.5pt; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: DauphinPlain, serif;\">Why do we use\r\nit?<o:p></o:p></span></h2><p>\r\n\r\n\r\n\r\n</p><p style=\"margin: 0cm 0cm 11.25pt; text-align: justify; background-image: initial; b