(15, 0, 1, 'ទៅដល់ខេត្តមណ្ឌលគី ទៅដល់ខេត្តមណ្ឌលគីរីហើយ មិនគួររំលងទៅកម្សាន្ត', 'Lorem Ipsum is simply dummy text of the printing', 'Lorem Ipsum គឺមានការប្រែប្រួលជាច្រើននៃអត្ថបទគម្ពីរ Lorem Ipsum គួរឱ្យជឿ។ ទំព័រដើមគឺមកពីផ្នែកទី', 'readable content of a page when looking at its layout. The point of using', 'uploads/1/2020-01/a.jpg', '<p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"KHM\" style=\"font-size: 22pt; font-family: DaunPenh;\">ហេតុអ្វីយើងប្រើវា</span></b><b><span style=\"font-size: 22pt; font-family: &quot;Open Sans&quot;, sans-serif;\">?<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 9pt; font-family: &quot;Khmer OS&quot;;\">Lorem Ipsum <span lang=\"KHM\">គឺវាជាការពិតដែលបានបង្កើតឡើងយូរមកហើយដែលអ្នកអាននឹងត្រូវបានរំខានដោយមាតិកាដែលអាចអានបាននៃទំព័រនៅពេលដែលក្រឡេកមើលប្លង់របស់វា។\r\nចំនុចនៃការប្រើ </span>Lorem Ipsum <span lang=\"KHM\">គឺថាវាមានការចែកចាយអក្សរធម្មតាឬមិនធម្មតាជាងផ្ទុយពីការប្រើប្រាស់មាតិកានៅទីនេះមាតិកានៅទីនេះធ្វើឱ្យវាមើលទៅដូចជាភាសាអង់គ្លេសដែលអាចអានបាន។\r\nកញ្ចប់បោះពុម្ភផ្សាយផ្ទៃតុជាច្រើននិងកម្មវិធីនិពន្ធទំព័របណ្តាញឥឡូវនេះប្រើ </span>Lorem\r\nIpsum <span lang=\"KHM\">ជាអត្ថបទគំរូលំនាំដើមរបស់ពួកគេហើយការស្វែងរក </span>\'lorem\r\nipsum\' <span lang=\"KHM\">នឹងបង្ហាញគេហទំព័រជាច្រើននៅមិនទាន់មាននៅឡើយទេ។\r\nកំណែជាច្រើនបានវិវឌ្ឍជាច្រើនឆ្នាំមកហើយជួនកាលដោយគ្រោះថ្នាក់ចរាចរណ៍ពេលខ្លះមានគោលបំណង\r\n(កំប្លុកកំប្លែងនិងការស្រដៀងគ្នា) ។</span><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"KHM\" style=\"font-size: 22pt; font-family: DaunPenh;\">តើវាមកពីណា</span></b><b><span style=\"font-size: 22pt; font-family: &quot;Open Sans&quot;, sans-serif;\">?<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 9pt; font-family: &quot;Khmer OS&quot;;\">Lorem Ipsum <span lang=\"KHM\">គឺផ្ទុយទៅនឹងជំនឿដ៏ពេញនិយម</span>, Lorem\r\nIpsum <span lang=\"KHM\">មិនមែនជាអត្ថបទចៃដន្យទេ។\r\nវាមានឫសគល់នៅក្នុងអក្សរសិល្ប៍ឡាតាំងបុរាណពីឆ្នាំ </span>45<span lang=\"KHM\"> ម។ គ។\r\nដែលធ្វើឱ្យវាមានអាយុកាលជាង </span>2000<span lang=\"KHM\"> ឆ្នាំ។ លោក </span>Richard\r\nMcClintock <span lang=\"KHM\">សាស្ត្រាចារ្យឡាតាំងនៅមហាវិទ្យាល័យ </span>Hampden-Sydney\r\n<span lang=\"KHM\">នៅរដ្ឋវីជីហ្គីបានមើលពាក្យឡាតាំងមួយដែលមិនច្បាស់លាស់ជាងមុនដែលជាភាសាអង់គ្លេសដែលមានអត្ថន័យជ្រាលជ្រៅពីអត្ថបទគម្ពីរ\r\n</span>Lorem Ipsum <span lang=\"KHM\">ហើយបានឆ្លងកាត់ពាក្យសម្ដីក្នុងអក្សរសិល្ប៍បុរាណហើយបានរកឃើញប្រភពមិនគួរឱ្យជឿ។\r\nទំព័រដើមគឺមកពីផ្នែកទី </span>1.10.32<span lang=\"KHM\"> និង </span>1.10.33<span lang=\"KHM\"> នៃ \"</span>de Finibus Bonorum et Malorum\" <span lang=\"KHM\">ដោយ\r\n</span>Cicero <span lang=\"KHM\">ដែលសរសេរនៅឆ្នាំ </span>45<span lang=\"KHM\"> មុនគ។ ស\r\n..\r\nសៀវភៅនេះគឺជាសក្ខីកម្មមួយស្តីពីទ្រឹស្តីក្រមសីលធម៌ដែលមានប្រជាប្រិយភាពបំផុតក្នុងសម័យកាលរាជវង្ស។\r\nបន្ទាត់ទីមួយនៃទំព័រដើមគឺ \"ពាក្យស្លោកនៃពាក្យស្លោក\"\r\nដែលចេញមកពីបន្ទាត់ក្នុងផ្នែក </span>1.10.32<span lang=\"KHM\"> ។</span><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"KHM\" style=\"font-size: 9pt; font-family: &quot;Khmer OS&quot;;\">កណ្តុរស្តង់ដារនៃ </span><span style=\"font-size: 9pt; font-family: &quot;Khmer OS&quot;;\">Lorem Ipsum <span lang=\"KHM\">ដែលត្រូវបានប្រើចាប់តាំងពីឆ្នាំ </span>1500<span lang=\"KHM\">\r\nត្រូវបានផលិតឡើងវិញសម្រាប់អ្នកដែលចាប់អារម្មណ៍។ ផ្នែកចំនួន </span>1.10.32<span lang=\"KHM\"> និង </span>1.10.33<span lang=\"KHM\"> ពី \"</span>de Finibus Bonorum\r\net Malorum\" <span lang=\"KHM\">ដោយ </span>Cicero <span lang=\"KHM\">ត្រូវបានផលិតឡើងវិញនៅក្នុងទម្រង់ដើមពិតប្រាកដរបស់ពួកគេដែលអមដោយកំណែជាភាសាអង់គ្លេសពីការបកប្រែឆ្នាំ\r\n</span>1914<span lang=\"KHM\"> ដោយលោក </span>H. Rackham <span lang=\"KHM\">។</span><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"KHM\" style=\"font-size: 22pt; font-family: DaunPenh;\">តើខ្ញុំអាចទទួលបានខ្លះ</span></b><b><span style=\"font-size: 22pt; font-family: &quot;Open Sans&quot;, sans-serif;\">?<o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 9pt; font-family: &quot;Khmer OS&quot;;\">Lorem Ipsum <span lang=\"KHM\">គឺមានការប្រែប្រួលជាច្រើននៃអត្ថបទគម្ពីរ </span>Lorem\r\nIpsum <span lang=\"KHM\">ដែលអាចរកបានប៉ុន្តែភាគច្រើនបានទទួលរងការកែសម្រួលក្នុងទម្រង់មួយចំនួនដោយការកំប្លុកកំប្លែងឬពាក្យចៃដន្យដែលមិនមើលទៅសូម្បីតែជឿតិចតួច។\r\nប្រសិនបើអ្នកនឹងប្រើអត្ថបទគម្ពីរ </span>Lorem Ipsum <span lang=\"KHM\">អ្នកត្រូវប្រាកដថាគ្មានអ្វីដែលលាក់កំបាំងនៅកណ្ដាលអត្ថបទទេ។\r\nរាល់ម៉ាស៊ីនភ្លើង </span>Ipsum <span lang=\"KHM\">ទាំងអស់នៅលើអ៊ីនធឺណែតមាននិន្នាការបង្កើតឡើងវិញនូវកំណាត់ដែលបានកំណត់ជាមុនដែលចាំបាច់ធ្វើឱ្យម៉ាស៊ីននេះក្លាយជាម៉ាស៊ីនភ្លើងពិតដំបូងនៅលើអ៊ីនធឺណិត។\r\nវាប្រើវចនានុក្រមជាង </span>200 <span lang=\"KHM\">ពាក្យឡាតាំងរួមជាមួយកោសិកានៃរចនាសម្ព័ន្ធប្រយោគគំរូមួយដើម្បីបង្កើត\r\n</span>Lorem Ipsum <span lang=\"KHM\">ដែលមើលទៅសមហេតុផល។ ការបង្កើត </span>Lorem\r\nIpsum <span lang=\"KHM\">គឺជានិច្ចកាលមិនគិតពីពាក្យដដែលៗការនិយាយកំប្លែងឬពាក្យដែលមិនមែនជាលក្ខណៈជាដើម។</span><o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"KHM\" style=\"font-size: 22pt; font-family: DaunPenh;\">ម៉្យាងវិញទៀតយើងប្តឹង</span></b><b><span style=\"font-size: 22pt; font-family: &quot;Open Sans&quot;, sans-serif;\"><o:p></o:p></span></b></p>', '<h1 style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size: 10.5pt; font-family: &quot;Open Sans&quot;, sans-serif;\">Lorem Ipsum</span><span style=\"font-size: 10.5pt; font-family: &quot;Open Sans&quot;, sans-serif;\">&nbsp;is\r\nsimply dummy text</span></b></h1><p style=\"margin: 0cm 0cm 0.0001pt; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; backgro