(20, 0, 1, 'បើក​ឡើង​ចំណោត​សាក​មើល​រួច​អត់', 'Lorem Ipsum is simply dummy text of the printing', 'Lorem Ipsum និងថ្មីៗនេះជាមួយនឹងកម្មវិធីបោះពុម្ភលើផ្ទៃតុដូចជា Aldus PageMaker រួមទាំងកំណែរបស់ Lorem Ipsum ផងដែរ។', 'of the word in classical literature, discovered the undoubtable source.', 'uploads/1/2020-01/c.jpg', '<p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"KHM\" style=\"font-size: 22pt; font-family: DaunPenh;\">ការផ្តល់ជូនពិសេសគឺត្រូវបានផ្តល់ជូនពិសេស</span></b><b><span style=\"font-size: 22pt; font-family: &quot;Open Sans&quot;, sans-serif;\"><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 9pt; font-family: &quot;Khmer OS&quot;;\">Lorem Ipsum <span lang=\"KHM\">គឺអ្នកនឹងទទួលបានពានរង្វាន់បន្ថែមទៀត។ អ្នកត្រូវតែអានលេខសម្គាល់របស់អ្នក</span>,\r\n<span lang=\"KHM\">ចុចលើប៊ូតុងកណ្ដុរខាងស្ដាំ។ អ្នកអាចរកមើលអ្វីគ្រប់យ៉ាងដែលអ្នកចង់បាន។\r\nវាត្រូវបានគេស្គាល់ថាជាជម្រើសដ៏ល្អបំផុតដែលមិនមានភាពស្រអាប់។ អ្នកអាចធ្វើបាន។ វាត្រូវបានបង្កើតឡើងដោយឥតគិតថ្លៃ</span>,\r\n<span lang=\"KHM\">ដែលអាចធ្វើទៅបាន។ វាត្រូវបានគេហៅថាធាតុដ៏សំខាន់មួយដែលត្រូវបានគេហៅថាការបណ្តុះបណ្តាល។\r\nអ្នកមិនមែនជាមនុស្សដែលមិនមែនជាមនុស្សដែលមិនមែនជាអ្នកបង្កើតនិងអ្នកទាំងពីរ។ អ្នកត្រូវចំណាយពេលច្រើនដើម្បីទទួលបានការចាប់អារម្មណ៍។\r\nវាត្រូវបានបង្កើតឡើងនៅលើឆាកអ័រគីយូអេសអេឌិន។ វាត្រូវបានគេស្គាល់ថាជាអ្នកប្រើប្រាស់ច្រើនបំផុត</span>,\r\nultrices <span lang=\"KHM\">នៅ </span>tortor <span lang=\"KHM\">។ វាមិនមែនជាអ្វីដែលអ្នកអាចធ្វើបាននោះទេ។\r\nបុរសម្នាក់នៅក្នុងរឿងអេក។</span><o:p><