(29, 0, 2, '​ចំណោត​សាក​មើល​រួច​អត់មានពាសពេញខ្មោចដែលមិនមានត្', 'The point of using Lorem Ipsum is that', 'មានពាសពេញខ្មោចដែលមិនមានត្រចៀកកាំ។ មុខឺម៉ិចត្រូវបានគេស្គាល់ថាជាពហុគុណ។ លោក Nam នៅលើសំណុំបែបបទ', 'it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like', 'uploads/1/2020-01/ia.jpg', '<p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 9pt; font-family: &quot;Khmer OS&quot;;\">Lorem Ipsum <span lang=\"KHM\">គឺ</span>Quisque <span lang=\"KHM\">និង </span>lectus\r\nac <span lang=\"KHM\">គឺជាលទ្ធផលនៃការនិងមិនមែន។ វាត្រូវបានគេប្រើដើម្បីកំណត់អត្តសញ្ញាណប្រភេទនេះ</span>,\r\n<span lang=\"KHM\">ប៉ុន្តែវាត្រូវបានបង្កើតឡើងដោយ </span>Malesuada <span lang=\"KHM\">ឬ។\r\nអ្នកគួរតែប្រើវិធីសាស្រ្តដើម្បីឱ្យវាមានលក្ខណៈធម្មតា។ អ្នកអាចរកទិញឬក៏អ្នកដាក់លក់ឬទិញផលិតផលដែលអ្នកទទួលបាន។\r\nមានពាសពេញខ្មោចដែលមិនមានត្រចៀកកាំ។ មុខឺម៉ិចត្រូវបានគេស្គាល់ថាជាពហុគុណ។ លោក </span>Nam\r\n<span lang=\"KHM\">នៅលើសំណុំបែបបទ។ បញ្ចប់ការដេញថ្លៃចុងក្រោយបំផុត។ វាត្រូវបានបង្កើតឡើងដោយប្រើឧបករណ៍អេឡិចត្រូនិច។\r\nសក្ដានុពលលឿន។ សាប៊ូលាបសន្លាក់។ វាត្រូវបានបង្កើតឡើងដោយមិនត្រូវបានបង្កើតឡើងដើម្បីឱ្យមានលទ្ធផលល្អ។\r\nវាត្រូវបានបង្កើតឡើងដើម្បីឱ្យមានការបើកចំហរនិងការធ្វើឱ្យប្រសើរឡើង។ អ្នកអាចរកមើលឃើញនូវអ្វីដែលអ្នកចង់បាន។\r\nប្រសិនបើអ្នកទទួលបានលទ្ធផល</span>, <span lang=\"KHM\">អ្នកគួរតែទទួលបានអាហារពេលព្រឹក។\r\nអ្នកមិនគួរអានឬអានសៀវភៅនេះទេ។ សូមអរគុណ។ នៅក្នុង </span>orci <span lang=\"KHM\">នៅកន្លែងកើតហេតុ\r\n</span>sodales <span lang=\"KHM\">ស្ងួត។ ក្រមួននិងឈើឆ្កាង។ អ្នកត្រូវធ្វើអត្តសញ្ញាណប័ណ្ណនិមួយៗ។</span></span><span style=\"font-size: 10.5pt; font-family: &quot;Open Sans&quot;, sans-serif;\"><o:p></o:p></span></p>', '<p><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; text-align: justify;\">It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</span><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; text-align: justify;\">It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</span><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; text-align: justify;\">It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</span><br></p>', 7, '2020-01-05 08:29:54', '2020-01-09 07:18:27');
