(273, '127.0.0.1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/79.0.3945.130 Safari/537.36', 'http://localhost:8000/admin/articles/edit-save/45', 'Update data ការផ្តល់ជូនពិសេសគឺត្រូវបានផ្តល់ជូនពិសេស at Articles', '<table class=\"table table-striped\"><thead><tr><th>Key</th><th>Old Value</th><th>New Value</th></thead><tbody><tr><td>user_id</td><td>0</td><td>1</td></tr><tr><td>article_kh</td><td><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 9pt; font-family: &quot;Khmer OS&quot;;\">Lorem Ipsum <span lang=\"KHM\">គឺអ្នកនឹងទទួលបានពានរង្វាន់បន្ថែមទៀត។ អ្នកត្រូវតែអានលេខសម្គាល់របស់អ្នក</span>,\r\n<span lang=\"KHM\">ចុចលើប៊ូតុងកណ្ដុរខាងស្ដាំ។ អ្នកអាចរកមើលអ្វីគ្រប់យ៉ាងដែលអ្នកចង់បាន។\r\nវាត្រូវបានគេស្គាល់ថាជាជម្រើសដ៏ល្អបំផុតដែលមិនមានភាពស្រអាប់។ អ្នកអាចធ្វើបាន។ វាត្រូវបានបង្កើតឡើងដោយឥតគិតថ្លៃ</span>,\r\n<span lang=\"KHM\">ដែលអាចធ្វើទៅបាន។ វាត្រូវបានគេហៅថាធាតុដ៏សំខាន់មួយដែលត្រូវបានគេហៅថាការបណ្តុះបណ្តាល។\r\nអ្នកមិនមែនជាមនុស្សដែលមិនមែនជាមនុស្សដែលមិនមែនជាអ្នកបង្កើតនិងអ្នកទាំងពីរ។ អ្នកត្រូវចំណាយពេលច្រើនដើម្បីទទួលបានការចាប់អារម្មណ៍។\r\nវាត្រូវបានបង្កើតឡើងនៅលើឆាកអ័រគីយូអេសអេឌិន។ វាត្រូវបានគេស្គាល់ថាជាអ្នកប្រើប្រាស់ច្រើនបំផុត</span>,\r\nultrices <span lang=\"KHM\">នៅ </span>tortor <span lang=\"KHM\">។ វាមិនមែនជាអ្វីដែលអ្នកអាចធ្វើបាន</span></span></p><p>\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 9pt; font-family: &quot;Khmer OS&quot;;\">Lorem Ipsum <span lang=\"KHM\">គឺ</span>Quisque <span lang=\"KHM\">និង </span>lectus\r\nac <span lang=\"KHM\">គឺជាលទ្ធផលនៃការនិងមិនមែន។ វាត្រូវបានគេប្រើដើម្បីកំណត់អត្តសញ្ញាណប្រភេទនេះ</span>,\r\n<span lang=\"KHM\">ប៉ុន្តែវាត្រូវបានបង្កើតឡើងដោយ </span>Malesuada <span lang=\"KHM\">ឬ។\r\nអ្នកគួរតែប្រើវិធីសាស្រ្តដើម្បីឱ្យវាមានលក្ខណៈធម្មតា។ អ្នកអាចរកទិញឬក៏អ្នកដាក់លក់ឬទិញផលិតផលដែលអ្នកទទួលបាន។\r\nមានពាសពេញខ្មោចដែលមិនមានត្រចៀកកាំ។ មុខឺម៉ិចត្រូវបានគេស្គាល់ថាជាពហុគុណ។ លោក </span>Nam\r\n<span lang=\"KHM\">នៅលើសំណុំបែបបទ។ បញ្ចប់ការដេញថ្លៃចុងក្រោយបំផុត។ វាត្រូវបានបង្កើតឡើងដោយប្រើឧបករណ៍អេឡិចត្រូនិច។\r\nសក្ដានុពលលឿន។ សាប៊ូលាបសន្លាក់។ វាត្រូវបានបង្កើតឡើងដោយមិនត្រូវបានបង្កើតឡើងដើម្បីឱ្យមានលទ្ធផលល្អ។\r\nវាត្រូវបានបង្កើតឡើងដើម្បីឱ្យមានការបើកចំហរនិងការធ្វើឱ្យប្រសើរឡើង។ អ្នកអាចរកមើលឃើញនូវអ្វីដែលអ្នកចង់បាន។\r\nប្រសិនបើអ្នកទទួលបានលទ្ធផល</span>, <span lang=\"KHM\">អ្នកគួរតែទទួលបានអាហារពេលព្រឹក។\r\nអ្នកមិនគួរអានឬអានសៀវភៅនេះទេ។ សូមអរគុណ។ នៅក្នុង </span>orci <span lang=\"KHM\">នៅកន្លែងកើតហេតុ\r\n</span>sodales <span lang=\"KHM\">ស្ងួត។ ក្រមួននិងឈើឆ្កាង។ អ្នកត្រូវធ្វើអត្តសញ្ញាណប័ណ្ណនិមួយៗ។</span></span><span style=\"font-size: 10.5pt; font-family: &quot;Open Sans&quot;, sans-serif;\"><o:p></o:p></span></p></td><td><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 9pt; font-family: \"Khmer OS\";\">Lorem Ipsum <span lang=\"KHM\">គឺអ្នកនឹងទទួលបានពានរង្វាន់បន្ថែមទៀត។ អ្នកត្រូវតែអានលេខសម្គាល់របស់អ្នក</span>,\r\n<span lang=\"KHM\">ចុចលើប៊ូតុងកណ្ដុរខាងស្ដាំ។ អ្នកអាចរកមើលអ្វីគ្រប់យ៉ាងដែលអ្នកចង់បាន។\r\nវាត្រូវបានគេស្គាល់ថាជាជម្រើសដ៏ល្អបំផុតដែលមិនមានភាពស្រអាប់។ អ្នកអាចធ្វើបាន។ វាត្រូវបានបង្កើតឡើងដោយឥតគិតថ្លៃ</span>,\r\n<span lang=\"KHM\">ដែលអាចធ្វើទៅបាន។ វាត្រូវបានគេហៅថាធាតុដ៏សំខាន់មួយដែលត្រូវបានគេហៅថាការបណ្តុះបណ្តាល។\r\nអ្នកមិនមែនជាមនុស្សដែលមិនមែនជាមនុស្សដែលមិនមែនជាអ្នកបង្កើតនិងអ្នកទាំងពីរ។ អ្នកត្រូវចំណាយពេលច្រើនដើម្បីទទួលបានការចាប់អារម្មណ៍។\r\nវាត្រូវបានបង្កើតឡើងនៅលើឆាកអ័រគីយូអេសអេឌិន។ វាត្រូវបានគេស្គាល់ថាជាអ្នកប្រើប្រាស់ច្រើនបំផុត</span>,\r\nultrices <span lang=\"KHM\">នៅ </span>tortor <span lang=\"KHM\">។ វាមិនមែនជាអ្វីដែលអ្នកអាចធ្វើបាន</span></span></p><p>\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 9pt; font-family: \"Khmer OS\";\">Lorem Ipsum <span lang=\"KHM\">គឺ</span>Quisque <span lang=\"KHM\">និង </span>lectus\r\nac <span lang=\"KHM\">គឺជាលទ្ធផលនៃការនិងមិនមែន។ វាត្រូវបានគេប្រើដើម្បីកំណត់អត្តសញ្ញាណប្រភេទនេះ</span>,\r\n<span lang=\"KHM\">ប៉ុន្តែវាត្រូវបានបង្កើតឡើងដោយ </span>Malesuada <span lang=\"KHM\">ឬ។\r\nអ្នកគួរតែប្រើវិធីសាស្រ្តដើម្បីឱ្យវាមានលក្ខណៈធម្មតា។ អ្នកអាចរកទិញឬក៏អ្នកដាក់លក់ឬទិញផលិតផលដែលអ្នកទទួលបាន។\r\nមានពាសពេញខ្មោចដែលមិនមានត្រចៀកកាំ។ មុខឺម៉ិចត្រូវបានគេស្គាល់ថាជាពហុគុណ។ លោក </span>Nam\r\n<span lang=\"KHM\">នៅលើសំណុំបែបបទ។ បញ្ចប់ការដេញថ្លៃចុងក្រោយបំផុត។ វាត្រូវបានបង្កើតឡើងដោយប្រើឧបករណ៍អេឡិចត្រូនិច។\r\nសក្ដានុពលលឿន។ សាប៊ូលាបសន្លាក់។ វាត្រូវបានបង្កើតឡើងដោយមិនត្រូវបានបង្កើតឡើងដើម្បីឱ្យមានលទ្ធផលល្អ។\r\nវាត្រូវបានបង្កើតឡើងដើម្បីឱ្យមានការបើកចំហរនិងការធ្វើឱ្យប្រសើរឡើង។ អ្នកអាចរកមើលឃើញនូវអ្វីដែលអ្នកចង់បាន។\r\nប្រសិនបើអ្នកទទួលបានលទ្ធផល</span>, <span lang=\"KHM\">អ្នកគួរតែទទួលបានអាហារពេលព្រឹក។\r\nអ្នកមិនគួរអានឬអានសៀវភៅនេះទេ។ សូមអរគុណ។ នៅក្នុង </span>orci <span lang=\"KHM\">នៅកន្លែងកើតហេតុ\r\n</span>sodales <span lang=\"KHM\">ស្ងួត។ ក្រមួននិងឈើឆ្កាង។ អ្នកត្រូវធ្វើអត្តសញ្ញាណប័ណ្ណនិមួយៗ។</span></span><span style=\"font-size: 10.5pt; font-family: \"Open Sans\", sans-serif;\"><o:p></o:p></span></p></td></tr><tr><td>article_en</td><td><p style=\"margin-bottom: 15px; padding: 0px; text-align: justify; font-family: &quot;Open Sans&quot;, Arial, sans