(1, 0, 1, 'អ្នកត្រូវចំណាយពេលច្រើនដើម្បីទទួលបានការចាប់អារម្មណ៍', 'Lorem Ipsum passage, and going through the cites of the word in classical', 'អ្នកត្រូវចំណាយពេលច្រើនដើម្បីទទួលបានការចាប់អារម្មណ៍។ វាត្រូវបានបង្កើតឡើងនៅលើឆាកអ័រគីយូអេសអេឌិន', 'Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered.', 'uploads/1/2020-01/5e0d95261fbfa_1577948400_small.jpg', '<p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"KHM\" style=\"font-size: 22pt; font-family: DaunPenh;\">ការផ្តល់ជូនពិសេសគឺត្រូវបានផ្តល់ជូនពិសេស</span></b><b><span style=\"font-size: 22pt; font-family: &quot;Open Sans&quot;, sans-serif;\"><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 9pt; font-family: &quot;Khmer OS&quot;;\">Lorem Ipsum <span lang=\"KHM\">គឺអ្នកនឹងទទួលបានពានរង្វាន់បន្ថែមទៀត។ អ្នកត្រូវតែអានលេខសម្គាល់របស់អ្នក</span>,\r\n<span lang=\"KHM\">ចុចលើប៊ូតុងកណ្ដុរខាងស្ដាំ។ អ្នកអាចរកមើលអ្វីគ្រប់យ៉ាងដែលអ្នកចង់បាន។\r\nវាត្រូវបានគេស្គាល់ថាជាជម្រើសដ៏ល្អបំផុតដែលមិនមានភាពស្រអាប់។ អ្នកអាចធ្វើបាន។ វាត្រូវបានបង្កើតឡើងដោយឥតគិតថ្លៃ</span>,\r\n<span lang=\"KHM\">ដែលអាចធ្វើទៅបាន។ វាត្រូវបានគេហៅថាធាតុដ៏សំខាន់មួយដែលត្រូវបានគេហៅថាការបណ្តុះបណ្តាល។\r\nអ្នកមិនមែនជាមនុស្សដែលមិនមែនជាមនុស្សដែលមិនមែនជាអ្នកបង្កើតនិងអ្នកទាំងពីរ។ អ្នកត្រូវចំណាយពេលច្រើនដើម្បីទទួលបានការចាប់អារម្មណ៍។\r\nវាត្រូវបានបង្កើតឡើងនៅលើឆាកអ័រគីយូអេសអេឌិន។ វាត្រូវបានគេស្គាល់ថាជាអ្នកប្រើប្រាស់ច្រើនបំផុត</span>,\r\nultrices <span lang=\"KHM\">នៅ </span>tortor <span lang=\"KHM\">។ វាមិនមែនជាអ្វីដែលអ្នកអាចធ្វើបាននោះទេ។\r\nបុរសម្នាក់នៅក្នុងរឿងអេក។</span><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"KHM\" style=\"font-size: 22pt; font-family: DaunPenh;\">អ្នកគួរតែទទួលបានលទ្ធផលល្អ</span></b><b><span style=\"font-size: 22pt; font-family: &quot;Open Sans&quot;, sans-serif;\"><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 9pt; font-family: &quot;Khmer OS&quot;;\">Lorem Ipsum <span lang=\"KHM\">គឺ</span>Quisque <span lang=\"KHM\">និង </span>lectus\r\nac <span lang=\"KHM\">គឺជាលទ្ធផលនៃការនិងមិនមែន។ វាត្រូវបានគេប្រើដើម្បីកំណត់អត្តសញ្ញាណប្រភេទនេះ</span>,\r\n<span lang=\"KHM\">ប៉ុន្តែវាត្រូវបានបង្កើតឡើងដោយ </span>Malesuada <span lang=\"KHM\">ឬ។\r\nអ្នកគួរតែប្រើវិធីសាស្រ្តដើម្បីឱ្យវាមានលក្ខណៈធម្មតា។ អ្នកអាចរកទិញឬក៏អ្នកដាក់លក់ឬទិញផលិតផលដែលអ្នកទទួលបាន។\r\nមានពាសពេញខ្មោចដែលមិនមានត្រចៀកកាំ។ មុខឺម៉ិចត្រូវបានគេស្គាល់ថាជាពហុគុណ។ លោក </span>Nam\r\n<span lang=\"KHM\">នៅលើសំណុំបែបបទ។ បញ្ចប់ការដេញថ្លៃចុងក្រោយបំផុត។ វាត្រូវបានបង្កើតឡើងដោយប្រើឧបករណ៍អេឡិចត្រូនិច។\r\nសក្ដានុពលលឿន។ សាប៊ូលាបសន្លាក់។ វាត្រូវបានបង្កើតឡើងដោយមិនត្រូវបានបង្កើតឡើងដើម្បីឱ្យមានលទ្ធផលល្អ។\r\nវាត្រូវបានបង្កើតឡើងដើម្បីឱ្យមានការបើកចំហរនិងការធ្វើឱ្យប្រសើរឡើង។ អ្នកអាចរកមើលឃើញនូវអ្វីដែលអ្នកចង់បាន។\r\nប្រសិនបើអ្នកទទួលបានលទ្ធផល</span>, <span lang=\"KHM\">អ្នកគួរតែទទួលបានអាហារពេលព្រឹក។\r\nអ្នកមិនគួរអានឬអានសៀវភៅនេះទេ។ សូមអរគុណ។ នៅក្នុង </span>orci <span lang=\"KHM\">នៅកន្លែងកើតហេតុ\r\n</span>sodales <span lang=\"KHM\">ស្ងួត។ ក្រមួននិងឈើឆ្កាង។ អ្នកត្រូវធ្វើអត្តសញ្ញាណប័ណ្ណនិមួយៗ។</span></span><span style=\"font-size: 10.5pt; font-family: &quot;Open Sans&quot;, sans-serif;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><br></p>', '<h2 style=\"margin-top: 0px; margin-right: 0px; margin-left: 0px; padding: 0px; line-height: 24px; font-family: DauphinPlain; font-size: 24px; color: rgb(0, 0, 0);\">Where does it come from?</h2><p style=\"margin-bottom: 15px; padding: 0px; text-align: justify; font-family: &quot;Open Sans&quot;, Arial, sans-serif;\">Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.</p><p style=\"margin-bottom: 15px; padding: 0px; text-align: justify; font-family: &quot;Open Sans&quot;, Arial, sans-serif;\">The standard chunk of Lorem Ipsum used since the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from \"de Finibus Bonorum et Malorum\" by Cicero are also reproduced in their exact original form, accompanied by English versions from the 1914 translation by H. Rackham.</p>', 1, '2019-12-29 21:10:52', '2020-01-04 22:33:33'),
(2, 0, 1, 'វាមិនមែនជាអ្វីដែលអ្នកអាចធ្វើបាននោះទេ។ បុរសម្នាក់នៅក្នុងរឿងអេក។', 'Many desktop publishing packages and web', 'វាមិនមែនជាអ្វីដែលអ្នកអាចធ្វើបាននោះទេ។ បុរសម្នាក់នៅក្នុងរឿងអេក។វាមិនមែនជាអ្វីដែលអ្នកអាចធ្វើបាននោះទេ។ បុរសម្នាក់នៅក្នុងរឿងអេក។', 'Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text', 'uploads/1/2020-01/5e0db0_small.jpg', '<p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"KHM\" style=\"font-size: 22pt; font-family: DaunPenh;\">ការផ្តល់ជូនពិសេសគឺត្រូវបានផ្តល់ជូនពិសេស</span></b><b><span style=\"font-size: 22pt; font-family: &quot;Open Sans&quot;, sans-serif;\"><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 9pt; font-family: &quot;Khmer OS&quot;;\">Lorem Ipsum <span lang=\"KHM\">គឺអ្នកនឹងទទួលបានពានរង្វាន់បន្ថែមទៀត។ អ្នកត្រូវតែអានលេខសម្គាល់របស់អ្នក</span>,\r\n<span lang=\"KHM\">ចុចលើប៊ូតុងកណ្ដុរខាងស្ដាំ។ អ្នកអាចរកមើលអ្វីគ្រប់យ៉ាងដែលអ្នកចង់បាន។\r\nវាត្រូវបានគេស្គាល់ថាជាជម្រើសដ៏ល្អបំផុតដែលមិនមានភាពស្រអាប់។ អ្នកអាចធ្វើបាន។ វាត្រូវបានបង្កើតឡើងដោយឥតគិតថ្លៃ</span>,\r\n<span lang=\"KHM\">ដែលអាចធ្វើទៅបាន។ វាត្រូវបានគេហៅថាធាតុដ៏សំខាន់មួយដែលត្រូវបានគេហៅថាការបណ្តុះបណ្តាល។\r\nអ្នកមិនមែនជាមនុស្សដែលមិនមែនជាមនុស្សដែលមិនមែនជាអ្នកបង្កើតនិងអ្នកទាំងពីរ។ អ្នកត្រូវចំណាយពេលច្រើនដើម្បីទទួលបានការចាប់អារម្មណ៍។\r\nវាត្រូវបានបង្កើតឡើងនៅលើឆាកអ័រគីយូអេសអេឌិន។ វាត្រូវបានគេស្គាល់ថាជាអ្នកប្រើប្រាស់ច្រើនបំផុត</span>,\r\nultrices <span lang=\"KHM\">នៅ </span>tortor <span lang=\"KHM\">។ វាមិនមែនជាអ្វីដែលអ្នកអាចធ្វើបាននោះទេ។\r\nបុរសម្នាក់នៅក្នុងរឿងអេក។</span><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span lang=\"KHM\" style=\"font-size: 22pt; font-family: DaunPenh;\">គឺជាអ្វីដែលខ្ញុំមាន</span></b><b><span style=\"font-size: 22pt; font-family: &quot;Open Sans&quot;, sans-serif;\">?<o:p></o:p></span></b></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 9pt; font-family: &quot;Khmer OS&quot;;\">Lorem Ipsum <span lang=\"KHM\">គឺគ្រាន់តែជាអត្ថបទអត់ចេះសោះនៃឧស្សាហកម្មបោះពុម្ពនិងកំណត់។\r\n</span>Lorem Ipsum <span lang=\"KHM\">គឺជាអត្ថបទក្លែងក្លាយរបស់ឧស្សាហកម្មដែលមិនធ្លាប់មានតាំងពីទសវត្សរ៍ឆ្នាំ\r\n</span>1500<span lang=\"KHM\">\r\nនៅពេលដែលម៉ាស៊ីនបោះពុម្ពមិនស្គាល់មួយបានថតរូបប្រភេទមួយហើយបានដាក់វាដើម្បីបង្កើតសៀវភៅគំរូ។\r\nវាបានរស់រានមានជីវិតមិនត្រឹមតែប្រាំសតវត្សប៉ុណ្ណោះទេប៉ុន្តែវាក៏ជាជំហានទៅជាការសរសេរជាអេឡិចត្រូនិចដែលនៅតែមិនផ្លាស់ប្តូរ។\r\nវាត្រូវបានប្រជាប្រិយភាពនៅទសវត្សឆ្នាំ </span>1960<span lang=\"KHM\">\r\nជាមួយនឹងការចេញផ្សាយសន្លឹក </span>Letraset <span lang=\"KHM\">ដែលមានអត្ថបទ </span>Lorem\r\nIpsum <span lang=\"KHM\">និងថ្មីៗនេះជាមួយនឹងកម្មវិធីបោះពុម្ភលើផ្ទៃតុដូចជា </span>Aldus\r\nPageMaker <span lang=\"KHM\">រួមទាំងកំណែរបស់ </span>Lorem Ipsum <span lang=\"KHM\">ផងដែរ។</span><o:p></o:p></span></p>', '<p><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; text-align: justify;\">It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</span><br></p>', 2, '2019-12-29 21:11:16', '2020-01-04 22:34:31'),
(3, 0, 2, 'បើក​ឡើង​ចំណោត​សាក​មើល​រួច​អត់', 'more-or-less normal distribution of letters', 'វាត្រូវបានគេស្គាល់ថាជាអ្នកប្រើប្រាស់ច្រើនបំផុត, ultrices នៅ tortor ។ វាមិនមែនជាអ្វីដែលអ្នកអាចធ្វើបាននោះទេ។ បុរសម្នាក់នៅក្នុងរឿងអេក។', 'The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters', 'uploads/1/2020-01/5e0d97df59b92_1577949120_small.jpg', '<p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 9pt; font-family: &quot;Khmer OS&quot;;\">Lorem Ipsum <span lang=\"KHM\">គឺអ្នកនឹងទទួលបានពានរង្វាន់បន្ថែមទៀត។ អ្នកត្រូវតែអានលេខសម្គាល់របស់អ្នក</span>,\r\n<span lang=\"KHM\">ចុចលើប៊ូតុងកណ្ដុរខាងស្ដាំ។ អ្នកអាចរកមើលអ្វីគ្រប់យ៉ាងដែលអ្នកចង់បាន។\r\nវាត្រូវបានគេស្គាល់ថាជាជម្រើសដ៏ល្អបំផុតដែលមិនមានភាពស្រអាប់។ អ្នកអាចធ្វើបាន។ វាត្រូវបានបង្កើតឡើងដោយឥតគិតថ្លៃ</span>,\r\n<span lang=\"KHM\">ដែលអាចធ្វើទៅបាន។ វាត្រូវបានគេហៅថាធាតុដ៏សំខាន់មួយដែលត្រូវបានគេហៅថាការបណ្តុះបណ្តាល។\r\nអ្នកមិនមែនជាមនុស្សដែលមិនមែនជាមនុស្សដែលមិនមែនជាអ្នកបង្កើតនិងអ្នកទាំងពីរ។ អ្នកត្រូវចំណាយពេលច្រើនដើម្បីទទួលបានការចាប់អារម្មណ៍។\r\nវាត្រូវបានបង្កើតឡើងនៅលើឆាកអ័រគីយូអេសអេឌិន។ វាត្រូវបានគេស្គាល់ថាជាអ្នកប្រើប្រាស់ច្រើនបំផុត</span>,\r\nultrices <span lang=\"KHM\">នៅ </span>tortor <span lang=\"KHM\">។ វាមិនមែនជាអ្វីដែលអ្នកអាចធ្វើបាននោះទេ។\r\nបុរសម្នាក់នៅក្នុងរឿងអេក។</span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 9pt; font-family: &quot;Khmer OS&quot;;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 11.25pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 9pt; font-family: &quot;Khmer OS&quot;;\">Lorem Ipsum <span lang=\"KHM\">គឺអ្នកនឹងទទួលបានពានរង្វាន់បន្ថែមទៀត។ អ្នកត្រូវតែអានលេខសម្គាល់របស់អ្នក</span>,\r\n<span lang=\"KHM\">ចុចលើប៊ូតុងកណ្ដុរខាងស្ដាំ។ អ្នកអាចរកមើលអ្វីគ្រប់យ៉ាងដែលអ្នកចង់បាន។\r\nវាត្រូវបានគេស្គាល់ថាជាជម្រើសដ៏ល្អបំផុតដែលមិនមានភាពស្រអាប់។ អ្នកអាចធ្វើបាន។ វាត្រូវបានបង្កើតឡើងដោយឥតគិតថ្លៃ</span>,\r\n<span lang=\"KHM\">ដែលអាចធ្វើទៅបាន។ វាត្រូវបានគេហៅថាធាតុដ៏សំខាន់មួយដែលត្រូវបានគេហៅថាការបណ្តុះបណ្តាល។\r\nអ្នកមិនមែនជាមនុស្សដែលមិនមែនជាមនុស្សដែលមិនមែនជាអ្នកបង្កើតនិងអ្នកទាំងពីរ។ អ្នកត្រូវចំណាយពេលច្រើនដើម្បីទទួលបានការចាប់អារម្មណ៍។\r\nវាត្រូវបានបង្កើតឡើងនៅលើឆាកអ័រគីយូអេសអេឌិន។ វាត្រូវបានគេស្គាល់ថាជាអ្នកប្រើប្រាស់ច្រើនបំផុត</span>,\r\nultrices <span lang=\"KHM\">នៅ </span>tortor <span lang=\"KHM\">។ វាមិនមែនជាអ្វីដែលអ្នកអាចធ្វើបាននោះទេ។\r\nបុរសម្នាក់នៅក្នុងរឿងអេក។</span><o:p></o:p></span></p>', '<p><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; text-align: justify;\">It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</span><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; text-align: justify;\">It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, </span></p><p><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; text-align: justify;\">as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</span><br></p>', 0, '2019-12-31 00:03:02', '2020-01-04 22:36:01'),
